import React from 'react';
import './Nav.css';

export const Nav = () => {
  return (
    <div class="nav">
        <div class="leftnav">
        </div>
        <div class="buttons">
            <a href='#'>Home</a>
            <a href='#'>About</a>
            <a href='#'>Dept</a>
            <a href='#'>Materials</a>
            <a href='#'>Contact</a>
            <a href='#'>Login</a>
            <div class="rightnav">
                <></>
            </div>
        </div>
    </div>
  )
}
export default Nav;
